const Services = () => {
  const navigate = useNavigate();
  const [selectedCategory, setSelectedCategory] = useState<string | null>(null);

  const selectedCenter = localStorage.getItem("selectedCenter") || "";
  const providersForSelected = selectedCategory && selectedCenter
    ? serviceProviders[selectedCategory]?.[selectedCenter] || []
    : [];

  const selectProvider = (provider: ServiceProvider) => {
    localStorage.setItem("selectedProvider", JSON.stringify(provider));
    navigate("/booking");
  };

  return (
    <section className="bg-gradient-to-br from-gray-900 via-black to-gray-800 text-white min-h-screen p-6">
      {!selectedCategory ? (
        <>
          <h2 className="text-3xl font-bold mb-6 text-center bg-gradient-to-r from-green-400 to-blue-500 bg-clip-text text-transparent">
            Services
          </h2>
          <div className="grid grid-cols-6 gap-4 mb-10 px-2">
            {serviceCategories.map((category, i) => (
              <motion.div
                key={i}
                onClick={() => setSelectedCategory(category.name)}
                className="flex flex-col items-center justify-center cursor-pointer p-4 rounded-lg bg-gray-800 hover:bg-green-500 transition-transform hover:scale-105"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: i * 0.05 }}
              >
                <img src={category.imageUrl} alt={category.name} className="w-12 h-12 mb-2" />
                <p className="text-sm text-center">{category.name}</p>
              </motion.div>
            ))}
          </div>
        </>
      ) : (
        <>
          <h2 className="text-3xl font-bold mb-6 text-center bg-gradient-to-r from-green-400 to-blue-500 bg-clip-text text-transparent">
            {selectedCategory} Service Providers in {selectedCenter}
          </h2>
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 max-w-7xl mx-auto">
            {providersForSelected.map((provider) => (
              <motion.div
                key={provider.id}
                className="bg-gray-800 hover:bg-green-600 rounded-xl overflow-hidden shadow-lg transition-transform hover:scale-105"
                initial={{ opacity: 0, y: 40 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.05 }}
              >
                <img src={provider.imageUrl} alt={provider.name} className="w-full h-40 object-cover" />
                <div className="p-4 text-center">
                  <p className="text-lg font-semibold">{provider.name}</p>
                  <p className="text-sm text-gray-300">Fee: {provider.fee}</p>
                  <p className="text-sm text-gray-400">Exp: {provider.experience} yrs</p>
                  <p className="text-sm text-yellow-400"> {provider.rating}</p>
                  <p className="text-sm text-gray-300">Contact: {provider.contact}</p>
                  <p className="text-sm text-gray-300">Email: {provider.email}</p>
                  <button
                    onClick={() => selectProvider(provider)}
                    className="mt-2 px-4 py-2 bg-green-500 rounded hover:bg-green-600"
                  >
                    Book Now
                  </button>
                </div>
              </motion.div>
            ))}
          </div>
        </>
      )}
    </section>
  );
};

export default Services;
